import { NavLink } from "react-router-dom";
import s from "../Styles/App.module.css";

const CutData = (props) => {
  return (
    <div>
      {props.data.map((el, index) => {
        return (
          <ul className={s.Articles}>
            <NavLink to="/src/components/Data.js">
              <li
                onClick={() => {
                  props.updateData(props.index);
                }}
              >
                <a>{props.CutData}</a>
              </li>
            </NavLink>
          </ul>
        );
      })}
    </div>
  );
};
